description:
Storyline: Two rival teams of government assassins work out of a top-secret underground facility and use code names from the Tarot deck. When new hire ?The Fool? (Anderson) joins the group, he arrives for his first day only to discover that the boss has been murdered and the office has been locked down and turned into a ticking time bomb. He must survive his ambitious co-workers, find the killer, and discover a way out before the whole place explodes.

Genre: Action | Comedy | Drama

Language: English


